import React, {useState, useEffect} from 'react';

import './ClientsStyle.css';
import '../../core/C';
import {C_ButtonIcon} from '../../core/Components';

export function Clients(props) {


    return (
        <div>
            <span className="div">
                <h1>Clientes</h1>
                <C_ButtonIcon icon="add" label="Criar Cliente"/>
            </span>
        </div>
    );
}
